import React from 'react';

const main = (props) => {
    return (
        <>
            <main role="main" className="col-md-9 ml-md-auto col-lg-11 ">
                <div className="d-flex justify-content-between flex-wrap flex-md-nowrap align-items-center pt-3 pb-2 mb-3 border-bottom">
                    {props.children}
                </div>
            </main>

        </>
    );
}

export default main;
